import img1 from "../photos/p1.jpg";
import img2 from "../photos/p2.jpg";
import img3 from "../photos/p3.jpg";
import img4 from "../photos/p4.jpg";
const imgs = {
  properties: [
    {
      _id: 0,
      index: 0,
      picture: img1,
    },
    {
      _id: 1,
      index: 1,
      picture: img2,
    },
    {
      _id: 2,
      index: 2,
      picture: img3,
    },
    {
      _id: 3,
      index: 3,
      picture: img4,
    },
  ],
};
export default imgs;
